document.addEventListener("DOMContentLoaded", function () {
    const video = document.createElement("video");
    const canvas = document.createElement('canvas');
    const context = canvas.getContext('2d');
    canvas.width = 120
    canvas.height = 160

    navigator.getUserMedia({ video: true },
        (stream) => video.srcObject = stream,
        e => { });

    function draw() {
        if (video.paused || video.ended) return false;
        const sim = document.getElementById('simframe');
        if (sim) {
            context.drawImage(video, 0, 0, canvas.width, canvas.height);
            // map rgb data to palette
            //
            // convert canvas to pxt image
            //
            let encoded = createBufferFromHex(bknd);
            // send image to pxt
            sim.contentWindow.postMessage({
                type: 'messagepacket',
                channel: 'webcam',
                data: encoded
            }, "*");
        }
    }

    // draw at 50fps
    setInterval(draw, 20);
    video.muted = true;
    video.play();
})

// 87 04 0100 0100 0000 0f 00 00 00

function createBufferFromHex(hex) {
    let r = createBuffer(hex.length >> 1)
    for (let i = 0; i < hex.length; i += 2)
        r[i >> 1] = parseInt(hex.slice(i, i + 2), 16)
    return r
}

function createBuffer(size) {
    return new Uint8Array(size);
}


